import styled from "styled-components";

interface priceProps {
  coinId: string;
}

interface priceProperties {
  beta_value: string;
  first_data_at: string;
  id: string;
  last_updated: string;
  max_supply: string;
  name: string;
  quotes: string;
  rank: string;
  symbol: string;
  total_supply: string;
}

const PriceBox = styled.div`
  display: flex;
`;

function Price({ coinId }: priceProps) {
  return (
    <>
      <PriceBox></PriceBox>
    </>
  );
}

export default Price;
